import React from 'react';


const FriendsList = props => {

    const username = "Mark";

    return (
        <div className="flex flex-col">
            <div id="profile"className="h-16  ">{username}</div>
            <div id="friends" className="h-auto border-solid border-b-2 border-black flex flex-col" >friends</div>

            <div id="chats" className="h-auto border-solid border-b-2 border-black">chats</div>


        </div>
    )
}



export default FriendsList;
